var imageData = "data:image/png;base64,";
var run = true;

chrome.extension.onRequest.addListener(function (request, sender) {
    if (request.greeting == 'hello' && run) {
        run = false;

        $('img').each(function (index, elem) {

            if ($(elem).width() > 100 ) {
                var temp = $('<img><img/>').
                    prop('src', imageData).
                    css('position', 'absolute').
                    css('z-index', 2147483647).
                    css('display', 'block').
                    width($(elem).width()).
                    height($(elem).height());

                $('body').append(temp);

                temp.offset($(elem).offset());
            }
        });
    }
});